import React from "react";
import { FormControl, Button } from "@mui/material";

const Form = () => {
  return (
    // & child
    <FormControl>
      <input type="text" placeholder="Email" />
      <input type="text" placeholder="Password" />
      <Button variant="standard"> Login</Button>
    </FormControl>
  );
};

export default Form;
